def is_prime(num: int) -> bool:
    if num < 2:
        return False
    for i in range(2, int(num ** 0.5) + 1):
        if num % i == 0:
            return False
    return True

# Helper function to find the largest prime factor
def largest_prime_factor_helper(n: int) -> int:
    # Start from the largest possible factor and work backwards
    for i in range(int(n ** 0.5), 1, -1):
        if n % i == 0 and is_prime(i):
            return i
    # If no prime factors found, return n itself (which is prime)
    return n

